import React from "react";
import { Route, BrowserRouter } from "react-router-dom";

import App from "./App";
import home from "./pages/home";

export default function Routes() {
   return(
       <BrowserRouter>
            <Route component = { App }  path="/" exact/>
            <Route component = { home }  path="/home" exact/>
       </BrowserRouter>
   )
}
